import { Container } from '@mui/system'
import { Button } from '@mui/material';
import { useNavigate, useHistory} from 'react-router-dom';


function UserData({person}) {
  const navigate = useNavigate();
  const history = useHistory();

  const EditUser = async (e) => {
    e.preventDefault();
    history.goBack();
    navigate('editUser')
  }
  const DeleteUser = async (e) => {
    e.preventDefault();
   //delete in DB

  }
  return (
    <Container>
      <br/>

      Full Name: {person.firstName +' '+ person.lastName}<br/><br/>
      User Name: {person.username}<br/><br/>
      Session time out:{person.sessionTimeOut}<br/><br/>
      Created data:{person.createdData}<br/><br/>
      Permissions:{person.permissions}<br/><br/>
      <Button sx={{padding: 1, marginTop: 2}} variant="outlined" type='submit' state={person} onClick={EditUser}>Edit</Button>
      <Button sx={{padding: 1, marginTop: 2, marginLeft:2}} variant="outlined" type='submit' onClick={DeleteUser}>Delete</Button>
    </Container>
  );
}

export default UserData;
